import React from "react";
import './style.css';
import Logo from "../../assets/logo.png";
import ImageButton from '../../assets/moon.png'


export default function Topo() {
    return(
        <header>
       <img src={ Logo } />

       <div>
        <button><img src={ ImageButton } alt="imagemdobuton"/></button>
       </div>

        </header>

    )
}
